,"-1929209278":"如果選擇「偶數」期權，只要最新價格的最後一個數字是偶數(如2、4、6、8或0)，將獲得賠付。","-2038865615":"如果選擇「奇數」期權，只要最新價格的最後一個數字是奇數(如1、3、5、7或9)，將獲得賠付。","-1416078023":"如果選擇「觸及」期權，只要市場在合約期限內的任何時間觸及障礙，將獲得賠付。","-1272255095":"如果退市現價等於障礙或重設後的新障礙，將不會贏得賠付。","-231957809":"如果退市現價高於或等於高障礙，可獲得最大賠付。","-464144986":"如果退市現價低於或等於低障礙，可獲得最大賠付。","-1031456093":"如果退市現價介於低、高障礙之間，其比例與高障礙及退市現價之間的差異相等，可獲得最大賠付。","-968162707":"如果退市現價高於或等於高障礙，不能獲得賠付。","-299450697":"如果選擇「高跳動點」，只要所選跳動點是接下來五個跳動點中的最高值，即可獲得賠付。","-705681870":"透過購入「最高值至最低值」 合約，將贏取合約期間內乘數值乘以最高值與最低值之間的差額。","-420387848":"最高值是市場在合約期內達到的最高點。","-1666375348":"透過購入「最高值至收盤」 合約，將贏取合約期間內乘數值乘以最高值與收盤之間的差額。","-2024955268":"如果選擇「上漲」期權，只要市場價格高於入市現價，平倉即可獲得賠付。","-1598433845":"如果選擇「下跌」期權，只要市場價格低於入市現價，平倉即可獲得賠付。","-885323297":"這是開盤的每一頭寸的可選參數：","-584696680":"如果選擇「止盈」並指定想要贏得的金額，那麼當盈利大於或等於該金額時，頭寸將自動平倉。獲利可能大於投入的金額，具體取決於收盤時的市場價格。","-1192494358":"如果選擇「取消交易」，當市場走勢對自己不利時可以在選定時間範圍內取消交易。此情況下我們僅收取些許費用，但是投注金額將會退還，沒有盈利或虧損。如果在取消交易到期之前達到了止損金額，頭寸將自動被取消，投注金額將退還，沒有任何盈利或虧損。","-178096090":"「止盈」無法更新。只能在「取消交易」到期時更新。","-206909651":"入市現價指伺服器處理合約完畢時的市價。","-1576967286":"該產品允許對標的資產表達大幅看漲或看跌推測。","-610471235":"如果您認為市場價格會在指定期限內持續上漲，請選擇<0>長倉</0>。如果市場價格沒有觸及或低於障礙，您將在到期時獲得賠付。如果未超出障礙，賠付將根據市場價格與障礙之間的差距成比例增長。當賠付高於投注額時，您將開始獲利。如果市場價格超出障礙，則不會有賠付。","-454245976":"如果您認為市場價格會在指定期限內持續下跌，請選擇<0>短倉</0>。如果市場價格沒有觸及或高於障礙，您將在到期時獲得賠付。如果未超出障礙，賠付將根據市場價格與障礙之間的差距成比例增長。當賠付高於投注額時，您將開始獲利。如果市場價格超出障礙，則不會有賠付。","-1790089996":"新建！","-993480898":"累計器","-45873457":"新建","-1422269966":"可以選擇值為 1%、2%、3%、4% 和 5% 的增長率。","-1186791513":"賠付額是初始投注額和利潤之和。","-1682624802":"它是之前現貨價格的百分比。百分比率取決於選擇的指數和增長率。","-1221049974":"最終價格","-1247327943":"這是到期時最後報價的現貨價格。","-878534036":"如果選擇「看跌」，當到期時最終價格高於行使價，將獲得賠付。否則，將不會獲得賠付。","-1587076792":"如果選擇「看跌」，當到期時最終價格低於行權價，將獲得賠付。否則，將不會獲得賠付。","-1482134885":"我們會根據選擇的行權價和期限計算。","-1890561510":"截止時間","-565990678":"合約將根據選擇的結束時間在該日期（格林威治標準時間）到期。","-127118348":"選擇 {{contract_type}}","-543478618":"嘗試檢查拼寫或使用其他字詞","-700280380":"交易取消費用","-1683683754":"長倉","-1046859144":"<0>{{title}}</0> 如果市場價格保持在 {{price_position}} 並且沒有觸及或超出障礙，將獲得賠付。否則，賠付將為零。",